Actionscript.script:
_parent.UpdateBigSmallState("技能中","一文字落雷中");
轻型武器攻击搓招 = _root.技能函数.轻型武器攻击搓招;
大型武器攻击搓招 = _root.技能函数.大型武器攻击搓招;
X轴追踪移动 = _root.敌人二级函数.X轴追踪移动;
Z轴追踪移动 = _root.敌人二级函数.Z轴追踪移动;

一文字落雷居合 = _root.技能函数.一文字落雷居合;
一文字落雷跳劈 =_root.技能函数.一文字落雷跳劈;

if (启动追踪)
{
	var 索敌距离 = 550;
	var 是否强行重新索敌 = true;
	var 优先索敌属性 = "距离";
	var 优先索敌排序 = "顺序";
	var 是否追踪 = true;
	var 敌人顺序 = 0;
	if (_root.控制目标 == _parent._name)
	{
		//if(Key.isDown(_root.武器变形键)){
		//是否强行重新索敌 = true;
		//}
		if (Key.isDown(_root.互动键))
		{
			优先索敌属性 = "血量";
			优先索敌排序 = "倒序";
		}
		if (Key.isDown(_root.奔跑键))
		{
			是否追踪 = false;
		}
	}
	var 追踪目标 = _parent.按距离索敌(索敌距离, 是否强行重新索敌, 优先索敌属性, 优先索敌排序);
	if (!追踪目标)
	{
		是否追踪 = false;
	}
}
else
{
	是否追踪 = false;
}

onClipEvent (load) {
	if (_parent._parent.刀 != "")
	{
		_parent._parent.根据模式重新读取武器加成("兵器");
	}
	this.onUnload = function()
	{
		if (_parent._parent.状态 == "技能")
		{
			_parent._parent.根据模式重新读取武器加成("空手");
		}
		else if (_parent._parent.攻击模式 != "")
		{
			_parent._parent.根据模式重新读取武器加成(_parent._parent.攻击模式);
		}
	};
}

onClipEvent(enterFrame){
   _parent.攻击时可改变移动方向(10);
}

onClipEvent (enterFrame) {
	if (!_parent.是否追踪)
	{
		_parent.攻击时按键四向移动(25,750);
	}
	else
	{
		_parent.X轴追踪移动(100,0,75);
		_parent.Z轴追踪移动(30);
	}
}

onClipEvent (load) {
	_parent._parent.skillShadow = this;
	if (!_root.是否阴影)
	{
		this._visible = false;
	}
	缩放乘数 = 3.611 * 175 / _parent._parent.身高;
	if (_parent._parent.技能浮空 == true)
	{
		if (_parent._parent.浮空)
		{
			this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
		}
	}
}
onClipEvent (enterFrame) {
	if (_root.是否阴影 and (_parent._parent.浮空 or (_parent._parent.技能浮空 == true)))
	{
		this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
	}
	else
	{
		this._y = 233.05;
	}
}
